lyrics:
Like a long lonely stream, I keep runnin' to-wards a dream;
 Movin' on, movin' on.
 Like a   branch on a tree, I keep reachin' to be free;
 Movin' on, movin' on.
'Cos there's a place in the sun, where there's hope for ev'ry-one.
Where my  poor restless heart's, gotta run.
There's a place in the sun, and be-fore my life is done;
 Got to find me a place in the sun.
Like an old dusty road, I get we-ary from the load;
 Movin' on, movin' on.
Like this tired, troubled earth, I've been rollin' since my birth;
 Movin' on, movin' on.
'Cos there's a place in the sun, where there's hope for ev'ry-one.
Where my  poor restless heart's, gotta run.
There's a place in the sun, and be-fore my life is done;
 Got to find me a place in the sun. I know...
'Cos there's a place in the sun, where there's hope for ev'ry-one.
Where my  poor restless heart's, gotta run.
There's a place in the sun, and be-fore my life is done;
 Got to find me a place in the sun.

 Cupid, draw back your bow, and let your arrow go;
 Straight to my lover's heart, for me, for me.
 Cupid, please hear my cry, and let your arrow fly;
 Straight to my lover's heart, for me...
Now, I don't mean to bother you, but I'm in distress;
There's danger of me losin' all of my happiness.
For I love a girl who doesn't know I exist;
 And this you can fix. So...
 Cupid, draw back your bow, and let your arrow go;
 Straight to my lover's heart, for me, for me.
 Cupid, please hear my cry, and let your arrow fly;
 Straight to my lover's heart, for me...
Now, Cupid, if your arrow makes her love strong for me,
I promise I will love her until eternity.
I know, between the two of us, her heart we can steal;
 Help me if you will. So...
 Cupid, draw back your bow, and let your arrow go;
 Straight to my lover's heart, for me, for me.
 Cupid, please hear my cry, and let your arrow fly;
 Straight to my lover's heart, for me... Now...
 Cupid, don't you hear me, calling you? I need you.
 Cupid, help me, I need you, Cupid, don't fail me...
